  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai National
  Wildlife Refuge summarizes refuge activities from January through April of 1953.
  \ The report begins with general information about weather conditions and fires
  on the refuge.  Wildlife- including migratory birds, upland game birds, big game
  animals, and fur animals- is also covered.  The report includes a refuge development
  section which discusses physical developments and range improvement on the refuge.
  \ Economic uses of the refuge are outlined; timber removal and fur harvesting were
  the primary uses during this period.  The public relations section of the report
  discusses recreational uses of the refuge, refuge visitors, refuge participation,
  hunting, fishing, and enforcement.  Items of interest and N-R forms are provided
  at the end of the report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
